const Header = () => {
	return (
		<div class="header">
		   <div class="tp-hdr">
		      <div class="logo-grp">
		         <img class="brand-logo" src="/assets/images/logo.png" alt="pizza store logo" />
		      </div>
            </div>
         </div>
	);
};

export default Header;
